import { useState, useEffect } from "react";
import database from "../utils/database";
import Loading from "../utils/Loading";

function Other() {

    const [ objects, setObjects ] = useState({
        objects: {},
        isLoaded: false
    })

    useEffect(() => {
        async function perform() {
            database.searchItems('qqch', {LOL: 'haha'}).then( array => {
            setObjects( {objects: array, isLoaded: true} )}).catch( _ => {
                setObjects( {objects: [{'1': {LOL: 'La base de données est vide.'}}], isLoaded: true} )
            })
        }
        perform();
    }, []);

    return objects.isLoaded ? <ul>{objects.objects.map(([ id, item ]) => {
        return <li key={id}>{item.LOL}</li>
    })}</ul> : <Loading />

}

export default Other;
